const canvas = document.querySelector("#canvas1") as HTMLCanvasElement;
const ctx = canvas.getContext("2d") as CanvasRenderingContext2D;

const image1 = new Image();

image1.src =
  "data:image/jpeg;base64,";

const inputSlider = document.querySelector("#resolution") as HTMLInputElement;
const inputLabel = document.querySelector(
  "#resolutionLabel"
) as HTMLLabelElement;

inputSlider.addEventListener("change", handleSlider);

const ta = document.querySelector("#to-text") as HTMLTextAreaElement;

class Cell {
  x: number;
  y: number;
  symbol: string;
  color: string;

  constructor(x: number, y: number, symbol: string, color: string) {
    this.x = x;
    this.y = y;
    this.symbol = symbol;
    this.color = color;
  }

  draw(ctx: CanvasRenderingContext2D) {
    ctx.fillStyle = "#ffffff56";
    ctx.fillText(this.symbol, this.x + 0.1, this.y + 0.1);
    ctx.fillStyle = this.color;
    ctx.fillText(this.symbol, this.x, this.y);
  }

  drawToText() {
    const word = this.symbol;
    const target = document.querySelector("#to-text") as HTMLTextAreaElement;
    if (target) {
      target.value += word;
    }
    // return word;
  }
}

class AsciiEffect {
  #imageCellArray: Cell[] = [];
  #symbols = [];
  #pixels: ImageData;
  #ctx!: CanvasRenderingContext2D;
  #width!: number;
  #height!: number;

  constructor(ctx: CanvasRenderingContext2D, width: number, height: number) {
    this.#ctx = ctx;
    this.#width = width;
    this.#height = height;
    ctx.drawImage(image1, 0, 0, this.#width, this.#height);
    this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height);
  }

  #convertToSymbol(g: number) {
    if (g > 250) return ".";
    else if (g > 240) return "#";
    else if (g > 220) return "&";
    else if (g > 200) return "%";
    else if (g > 180) return "$";
    else if (g > 160) return "R";
    else if (g > 140) return "W";
    else if (g > 120) return "P";
    else if (g > 100) return "X";
    else if (g > 80) return "E";
    else if (g > 60) return "T";
    else if (g > 40) return "A";
    else if (g > 20) return "O";
    else return "*";
  }

  #scanImagePromise(cellSize: number) {
    return new Promise((resolve) => {
      this.#imageCellArray = [];
      for (let y = 0; y < this.#pixels.height; y += cellSize) {
        for (let x = 0; x < this.#pixels.width; x += cellSize) {
          const posX = x * 4;
          const posY = y * 4;
          const pos = posY * this.#pixels.width + posX;

          if (this.#pixels.data[pos + 3] > 128) {
            const red = this.#pixels.data[pos];
            const green = this.#pixels.data[pos + 1];
            const blue = this.#pixels.data[pos + 2];
            const total = red + green + blue;
            const averageColorValue = total / 3;
            const color = "rgb(" + red + ", " + green + ", " + blue + ")";
            const symbol = this.#convertToSymbol(averageColorValue);

            /*     (   ) */
            if (total > 160)
              this.#imageCellArray.push(new Cell(x, y, symbol, color));
          }
        }
      }
      resolve(true);
    });
  }

  #drawAsciiPromise() {
    return new Promise((resolve) => {
      this.#clear();
      for (let i = 0; i < this.#imageCellArray.length; i++) {
        this.#imageCellArray[i].draw(this.#ctx);
      }
      resolve(true);
    });
  }

  #scanImage(cellSize: number) {
    this.#imageCellArray = [];
    for (let y = 0; y < this.#pixels.height; y += cellSize) {
      for (let x = 0; x < this.#pixels.width; x += cellSize) {
        const posX = x * 4;
        const posY = y * 4;
        const pos = posY * this.#pixels.width + posX;

        if (this.#pixels.data[pos + 3] > 128) {
          const red = this.#pixels.data[pos];
          const green = this.#pixels.data[pos + 1];
          const blue = this.#pixels.data[pos + 2];
          const total = red + green + blue;
          const averageColorValue = total / 3;
          const color = "rgb(" + red + ", " + green + ", " + blue + ")";
          const symbol = this.#convertToSymbol(averageColorValue);

          /*     (   ) */
          if (total > 160)
            this.#imageCellArray.push(new Cell(x, y, symbol, color));
        }
      }
    }
  }

  #clear() {
    this.#ctx.clearRect(0, 0, this.#width, this.#height);
  }

  #drawAscii() {
    this.#clear();
    for (let i = 0; i < this.#imageCellArray.length; i++) {
      this.#imageCellArray[i].draw(this.#ctx);
    }
  }

  draw(cellSize: number) {
    this.#scanImage(cellSize);
    this.#drawAscii();
  }

  async drawPromise(cellSize: number) {
    await this.#scanImagePromise(cellSize);
    await this.#drawAsciiPromise();
  }
}

let effect: AsciiEffect;

function drawOriginal() {
  inputLabel.innerHTML = "Original image";
  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
}

function drawAsInputValue() {
  ctx.font = `bold ${canvas.width * 0.05}px sans-serif`;
  ctx.textAlign = "center";
  ctx.fillStyle = "#fff";
  ctx.fillText("render image to ascii...", canvas.width / 2, canvas.height / 2);

  setTimeout(() => {
    inputLabel.innerHTML = "Resolution: " + inputSlider.value + " px";
    ctx.font = "bold " + parseInt(inputSlider.value) * 1.2 + "px Verdana";
    effect.drawPromise(+inputSlider.value);
  }, 500);
}

function handleSlider() {
  if (+inputSlider.value === 1) {
    drawOriginal();
  } else {
    drawAsInputValue();
  }
}

image1.onload = async function initialize() {
  ta.style.width = image1.width + "px";
  ta.style.height = image1.height + "px";

  canvas.width = image1.width;
  canvas.height = image1.height;
  effect = new AsciiEffect(ctx, image1.width, image1.height);
  drawAsInputValue();
};
